import React from 'react'
import './intro.css';

import { Navbar, Container} from 'react-bootstrap';

class Intro extends React.Component {
    render() {
        return <>
            <Navbar bg="dark">
                <Container>
                    <Navbar.Brand href="#home">
                        <img
                            src={require('~/Portfolio/my-portfolio/src/icons8-mix-logo.svg')}
                            width="30"
                            height="30"
                            className="d-inline-block align-top"
                            alt="React Bootstrap logo"
                        />
                    </Navbar.Brand>
                </Container>
            </Navbar>
            <h1 style={{ color: "wheat" }}>First ever react app of my own.</h1>
        </>
    }
}

export default Intro;
